import React, { useState, useEffect } from "react";
import './forecast.css';
import leftImg from './images/bgleft.png'
const apiKey = "ce7b63cece294cbb99183108231912";

const Searchpage = () => {

    const todaysdate = new Date();
    let curr_time = todaysdate.toString().slice(16, 21);
    let month = todaysdate.toString().slice(4, 8);
    let weekDay = todaysdate.toString().slice(0, 3);

    const [city, setCity] = useState('');
    const [resData, setResponse] = useState([]);
    const [cityName, setCityName] = useState('');
    const [cityRegion, setCityRegion] = useState('');
    const [data, setData] = useState([]);
    const [ID, setID] = useState('');

    const [date, setDate] = useState('');
    const [curr_temp, setCurrTemp] = useState('');
    const [curr_weather, setCurrWeather] = useState('');
    const [curr_icon, setCurrIcon] = useState('');

    let URL = `https://api.weatherapi.com/v1/current.json?key=${apiKey}&q=id:${ID}&aqi=yes`
    let IDURL = `http://api.weatherapi.com/v1/search.json?key=${apiKey}&q=${city}`

    useEffect(() => {
        const GetID = async () => {
            const response = await fetch(IDURL);
            const Rjson = await response.json();
            setResponse(Rjson);
            setID(Rjson[0].id);
            setCityName(Rjson[0].name);
            setCityRegion(Rjson[0].region);
        }
        GetID();

    }, [city]);

    const GetInfo = async () => {
        const res = await fetch(URL);
        const resJson = await res.json();
        setData(resJson);
        setCurrTemp(data.current.temp_c);
        setCurrWeather(data.current.condition.text);
        setCurrIcon(data.current.condition.icon);
        let curr_date = data.location.localtime;
        let today = curr_date.slice(8,10);
        let year = curr_date.slice(0,4);
        curr_date = `${today} ${month} ${year}`;
        setDate(curr_date);

    }

    return (
        <>
            <div className="container_forecast">
                <div className="container_center">
                    <div className="left_forecast">

                        <div className="search_div">
                            <i className='fa-solid fa-search search_glass'></i>
                            <input type="text" placeholder="Search Location"
                                className='search_bar'
                                value={city}
                                onChange={(e) => {
                                    setCity(e.target.value);
                                }}
                                onKeyDown={(event) => {
                                    if (event.key === "Enter") {
                                        GetInfo();
                                    }
                                }}
                            />
                            <div className="suggestions">
                                <ul className="suggest_ul">
                                    {
                                        resData.length > 0 ?
                                            resData.map((item) => {
                                                return <li className="suggest_li"

                                                    onClick={() => {
                                                        setCity(item.name);
                                                        setResponse([]);
                                                        GetInfo();
                                                    }}>
                                                    {item.name}</li>
                                            }) :
                                            null
                                    }
                                </ul>
                            </div>
                        </div>
                        <div className="datetime">
                            <div>
                                <div className="citytime"><i class="fa-solid fa-location-dot arrow"></i> {cityName? cityName+","+cityRegion :""} </div>
                                <div className="date">{date}</div>
                            </div>
                            <div>
                                <div className='citytime'>{curr_time}</div>
                                <div className="date">{weekDay}</div>
                            </div>
                        </div>
                        <div className="temp_div">
                            <p className="temperature">{curr_temp} &deg;C</p>
                            <div className="day_weather">{curr_weather} <img className="weather_icon" alt="Error" src={curr_icon} /></div>
                        </div>
                    </div>

                    <div className="right_forecast">
                    <div className="dailyForecast">

                    </div>
                    <div className="moreInfo">
                            <p className="more">More Details of Today's Weather</p>
                            <div className='grid_container'>
                                <div className="grid_div">1</div>
                                <div className="grid_div">2</div>
                                <div className="grid_div">3</div>
                            </div>
                            <div className='grid_container'>
                                <div className="grid_div">4</div>
                                <div className="grid_div">5</div>
                                <div className="grid_div">6</div>
                            </div>
                        </div>
                    </div>
                </div>
            </div>

        </>
    )
}

export default Searchpage;
